import React from 'react';
import { Drawer, List, ListItem, ListItemText, Typography, Box } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

function Sidebar({ isOpen, toggleDrawer }) {
    return (
        <Drawer open={isOpen} onClose={toggleDrawer} variant="persistent">
            <Box sx={{ width: 250, p: 2 }}>
                <Typography variant="h6" noWrap>
                    AltIndex
                </Typography>
                <List>
                    {['Top Stocks', 'Data Bits', 'Reddit Mentions', 'News Mentions', '4chan Mentions', 'Instagram Followers', 'Facebook Followers', 'TikTok Followers', 'Threads Followers'].map((text, index) => (
                        <ListItem button key={index}>
                            <ListItemText primary={text} />
                        </ListItem>
                    ))}
                </List>
            </Box>
        </Drawer>
    );
}

export default Sidebar;
